import React from "react";
import "./App.css";
import Sidenav from "./compo/Sidenav";
import { Route, Routes } from "react-router-dom";
import Home from "./compo/Home";
import About from "./compo/About";
import Contact from "./compo/Contact";
import Meditation from "./compo/Meditation";
import NotFound from "./compo/NotFound";
import Profile from "./compo/Profile";
import Services from "./compo/Services";
import Yoga from "./compo/Yoga";
import Hero from "./compo/Hero";
import Course from "./compo/Course";
import Qoute from "./compo/Qoute";
import Article from "./compo/Article";
import Footer from "./compo/Footer";

function App() {
  return (
    <>
      {/* <Navbar /> */}
      <Sidenav />
      {/* <Hero />
      <Qoute />
      <Course />
      <Article />
      <Footer /> */}
      <Routes>
        {/* for views of app */}
        <Route exact path="/" element={<Home />} />
        <Route path="/profile/" element={<Profile />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/yoga" element={<Yoga />} />
        <Route path="/meditation" element={<Meditation />} />
        <Route path="*" element={<NotFound />} />
        <Route path="/notfound" element={<NotFound />} />
        <Route path="/services" element={<Services />} />
        <Route path="/about-us" element={<About />} />
      </Routes>
    </>
  );
}

export default App;
